Tucked in the heart of Old Town Alexandria, @capoitaliandeli is serving up Italian classics with so much flavor! Pro tip: don’t skip the hoagie 🥖

@capoitaliandeli is new to Old Town! If you’re looking for something delish, quick, and nice + filling… you’ve gotta try one of their classics! My go-to is always an Italian sub, but I changed it up this time and got the Caprese but added prosciutto! My mouth is literally watering as I write this, lol. 

Drop in and let me know which sub was your favorite!! Highly recommend placing the same order as me! SO good! Happy weekend, friends!! ✨
